import React, { Component } from 'react'
import '../App.css'
import Test from './test.js'

export default class Serch extends Component {
constructor(props){
    super(props);
}

handleChange = (e) =>{
    this.props=e.target.value
}
    render() {
       const numu = this.props.numu
        return (
            <div>
                <input type="text"  onChange={this.handleChange} />
                <Test id={numu}/>
            </div>
        )
    }
}
